full_description:
Minger Strip Light, Light Your Wonderful Life


Application:
It can stay outdoors on a rainy day(protecting your adapter with a plastic cover), so it is widely used for home decoration, patio, garden, kitchen, hotels, clubs, shopping mall, bars, shops, restaurants, casino; 
Architectural decorative lighting, boutique atmosphere lighting;  
Extensively applied in Back Lighting, concealed lighting, channel letter lighting;  
Emergency &lamp, security lighting, advertisement sign lighting;  
Decorative lights for holiday, event, show exhibition, weddings, birthday party, school party, dancing party, Christmas, Thanksgiving Day, Saint Valentine Day, Halloween;  
Applicable for automobile and bicycle decoration, TV, studio, vehicle, border or contour lighting; 


Features:  
1. Low power consumption, super-bright but running with low temperature; 
2. All the light spread and completely smooth, luminous very even; 
3. Every 3-LEDS cuttable without damaging the rest strips, according to your requirement; 
4. Self-adhesive back with Adhesive tape for secure and easy application; 
5. LED type: High quality 5050 SMD LED, high intensity and reliability. Long lifespan >50,000 hours; 
6. 6A 12V Power Supply: High brightness, brighter than 5A and 2A power supply. More safety and low temperature. 


Zero-Risk Purchase,100% Satisfaction Guarantee 90 days 100% Money-Back Guarantee.we'll refund you immediately if you are not satisfied with our products.


About Minger Light
Minger is a professional provider of LED light products.We are not the best, but the right, which means starting with affordable, high-quality gear and ending with a commitment to 100% user satisfaction. After all, we're customers too.

